                <div key={s.id}>
                    <p>id : {s.id}</p>
                    <p>name : {s.name}</p>
                    <p>username : {s.username}</p>
                    <p>email : {s.email}</p>
                </div>
            </div>
        </>
        :
        <button className='load'>
            loading...
        </button>

    return (
        <div className='container'>
            {jsxResult}
        </div>
    )
}
